contracts/EthSender.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.3;

import { EthWallet } from "./EthWallet.sol";

import "../interfaces/IEvents.sol";
import "../interfaces/IErrors.sol";

contract EthSender is IEvents, IErrors {
    address public owner;
    EthWallet private recipientWallet;

    constructor() {
        owner = msg.sender;
    }

    modifier hasEnoughEth(uint _amountToSend) {
        uint _balance = address(this).balance;

        if(_amountToSend > _balance) {
            revert InsufficientFunds(_balance, _amountToSend);
        }

        _;
    }

    function getContractBalance() public view returns (uint) {
        return address(this).balance;
    }

    function deposit() external payable {
        //
    }

    function sendEth(address payable _recipient, uint _amount) 
    hasEnoughEth(_amount) 
    public
    payable 
    {
        (bool success, ) = address(_recipient).call{value: _amount}("");

        if(!success) {
            revert TransactionFailed(_amount, _recipient);
        }

        emit EthSent(_amount, _recipient);
    }
}

interfaces/IErrors.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.3;

interface IErrors {
    error InsufficientFunds(uint _balance, uint _amountToSend);
    error InsufficientPrivileges(string message);
    error TransactionFailed(uint _amountToSend, address _recipient);
}

interfaces/IEvents.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.3;

interface IEvents {
    event EthSent(uint _amount, address _recipient);
    event EthReceived(address _sender, uint _amount);
    event EthWithdrawn(uint _amount);
}

contracts/EthWallet.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.3;

import "../interfaces/IEvents.sol";
import "../interfaces/IErrors.sol";

contract EthWallet is IEvents, IErrors {
    address public owner;

    constructor() {
        owner = msg.sender;
    }

    modifier hasEnoughEth(uint _amount) {
        uint _balance = address(this).balance;

        if(_balance < _amount) {
            revert InsufficientFunds(_balance, _amount);
        }

        _;
    }

    modifier isOwnerOfWallet() {
        if(msg.sender != owner) {
            revert InsufficientPrivileges("You can only withdraw from your wallet");
        }

        _;
    }

    receive() external payable {
        emit EthReceived(msg.sender, msg.value);
    }

    function withdrawEth(uint _amount) isOwnerOfWallet hasEnoughEth(_amount) public {
        /*
        *   WITHDRAW ETH LOGIC (SEND ETH BACK TO WALLET)
        */
        emit EthWithdrawn(_amount);
    }

    function getContractBalance() public view returns (uint) {
        return address(this).balance;
    }
}

